ENBRIDGE TRANSPORTATION (IL-OK) L.L.C.
RULES AND REGULATIONS
GOVERNING THE TRANSPORTATION OF
CRUDE PETROLEUM
BY PIPELINE
GENERAL APPLICATION The Rules and Regulations published herein apply only under tariffs making specific reference by FERC number to this tariff; such reference will include supplements hereto and successive issues hereof. [N] Filed in compliance with 18 C.F.R. 341.3 (Form of tariff). The provisions published herein will, if effective, not result in an effect on the quality of the human environment.
ISSUED: February 27, 2019 EFFECTIVE: April 1, 2019
